import React from 'react'

function DibujoModelos(props) {
   let modelo=null
    switch (props.modelo) {
        case "Botone":
            modelo=<img src="nookweb/src/components/Respaldo/Respaldo/Croquis/DibujoModelos/Botone.svg" alt='botoneImg' />
            break;
    
        default:
            modelo=null;
            break;
    }

    return (
        <div>
            {modelo}
        </div>
    )
}

export default DibujoModelos
